import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card'
import './index.css'
import object from './Object'

function netCard(net){
  return(
    <Card 
    imgsrc={net.imgsrc}
    title={net.title}
    sname={net.sname}
    links={net.links}
    />
  )
}

ReactDOM.render(
  <>
  <hl className="heading-style">list of 5 netflix super seires</hl>

   {object.map(netCard)}
   </>
  ,document.getElementById('root')
);
